import React, { useState } from 'react';
import {
  Card,
  CardMedia,
  Typography,
  Box,
  IconButton,
  Chip,
  styled,
} from '@mui/material';
import {
  Close as CloseIcon,
  Favorite as FavoriteIcon,
  Star as StarIcon,
  LocationOn as LocationIcon,
  School as SchoolIcon,
  Work as WorkIcon,
} from '@mui/icons-material';

const CardWrapper = styled(Card)(({ theme }) => ({
  width: '100%',
  height: '100%',
  maxHeight: '600px',
  backgroundColor: theme.palette.background.paper,
  borderRadius: theme.shape.borderRadius * 2,
  boxShadow: '0 4px 12px rgba(0, 0, 0, 0.1)',
  position: 'relative',
  overflow: 'hidden',
}));

const CardOverlay = styled(Box)(({ theme }) => ({
  position: 'absolute',
  bottom: 0,
  left: 0,
  right: 0,
  background: 'linear-gradient(to top, rgba(0,0,0,0.8) 0%, rgba(0,0,0,0.4) 50%, transparent 100%)',
  padding: theme.spacing(2),
  color: 'white',
  borderBottomLeftRadius: theme.shape.borderRadius * 2,
  borderBottomRightRadius: theme.shape.borderRadius * 2,
}));

const ActionButtons = styled(Box)(({ theme }) => ({
  position: 'fixed',
  bottom: theme.spacing(6),
  left: '50%',
  transform: 'translateX(-50%)',
  display: 'flex',
  justifyContent: 'center',
  gap: theme.spacing(3),
  zIndex: 2,
  width: '100%',
  maxWidth: '340px',
}));

const ActionButton = styled(IconButton)(({ theme, color }) => ({
  backgroundColor: '#fff',
  border: `2px solid ${
    color === 'like' 
      ? theme.palette.success.main 
      : color === 'superlike' 
        ? '#00bcd4' 
        : theme.palette.error.main
  }`,
  padding: theme.spacing(1.5),
  transition: 'all 0.2s ease',
  '&:hover': {
    backgroundColor: color === 'like' 
      ? theme.palette.success.main 
      : color === 'superlike' 
        ? '#00bcd4' 
        : theme.palette.error.main,
    transform: 'scale(1.1)',
    '& svg': {
      color: 'white',
    },
  },
  '& svg': {
    color: color === 'like' 
      ? theme.palette.success.main 
      : color === 'superlike' 
        ? '#00bcd4' 
        : theme.palette.error.main,
    fontSize: '1.8rem',
    transition: 'color 0.2s ease',
  },
}));

const ActionIndicator = styled(Box)(({ type }) => ({
  position: 'absolute',
  top: '50%',
  left: '50%',
  transform: 'translate(-50%, -50%)',
  padding: '12px 24px',
  borderRadius: '8px',
  fontSize: '32px',
  fontWeight: 'bold',
  textTransform: 'uppercase',
  border: '4px solid',
  zIndex: 10,
  backgroundColor: 'rgba(255, 255, 255, 0.9)',
  ...(type === 'like' ? {
    color: '#4CAF50',
    borderColor: '#4CAF50',
  } : type === 'superlike' ? {
    color: '#00bcd4',
    borderColor: '#00bcd4',
  } : {
    color: '#f44336',
    borderColor: '#f44336',
  }),
}));

const PhotoNavigation = styled(Box)({
  position: 'absolute',
  top: 0,
  left: 0,
  right: 0,
  height: '75%',
  display: 'flex',
});

const PhotoNavArea = styled(Box)({
  flex: 1,
  cursor: 'pointer',
});

const PhotoIndicators = styled(Box)(({ theme }) => ({
  position: 'absolute',
  top: theme.spacing(2),
  left: 0,
  right: 0,
  display: 'flex',
  justifyContent: 'center',
  gap: theme.spacing(1),
  padding: theme.spacing(0, 2),
  zIndex: 2,
}));

const PhotoIndicator = styled(Box)(({ active, theme }) => ({
  height: 4,
  flex: 1,
  maxWidth: 60,
  backgroundColor: active ? 'white' : 'rgba(255, 255, 255, 0.5)',
  borderRadius: 2,
  transition: 'background-color 0.3s ease',
}));

const SwipeCard = ({ user, onLike, onPass, onSuperLike }) => {
  const [currentPhotoIndex, setCurrentPhotoIndex] = useState(0);
  const [action, setAction] = useState(null);
  const [isAnimating, setIsAnimating] = useState(false);

  const handleAction = (type) => {
    if (isAnimating) return;
    
    setIsAnimating(true);
    setAction(type);

    setTimeout(() => {
      if (type === 'like') onLike();
      else if (type === 'superlike') onSuperLike?.();
      else onPass();
    }, 500);
  };

  const handlePhotoNavigation = (e) => {
    const rect = e.currentTarget.getBoundingClientRect();
    const x = e.clientX - rect.left;
    const width = rect.width;

    if (x < width / 2 && currentPhotoIndex > 0) {
      setCurrentPhotoIndex(prev => prev - 1);
    } else if (x >= width / 2 && currentPhotoIndex < user.profile.photos.length - 1) {
      setCurrentPhotoIndex(prev => prev + 1);
    }
  };

  return (
    <CardWrapper>
      {action && (
        <ActionIndicator type={action}>
          {action === 'like' ? 'LIKE' : action === 'superlike' ? 'SUPER' : 'NOPE'}
        </ActionIndicator>
      )}

      <CardMedia
        component="img"
        height="100%"
        image={user.profile.photos[currentPhotoIndex]}
        alt={`${user.profile.firstName}'s photo`}
        sx={{ objectFit: 'cover' }}
      />

      <PhotoNavigation>
        <PhotoNavArea onClick={handlePhotoNavigation} />
      </PhotoNavigation>

      <PhotoIndicators>
        {user.profile.photos.map((_, index) => (
          <PhotoIndicator
            key={index}
            active={index === currentPhotoIndex}
          />
        ))}
      </PhotoIndicators>

      <CardOverlay>
        <Typography variant="h5" component="div" sx={{ mb: 1 }}>
          {user.profile.firstName}, {user.profile.age}
        </Typography>
        
        <Box sx={{ display: 'flex', alignItems: 'center', mb: 1 }}>
          <LocationIcon sx={{ mr: 1, fontSize: '1.2rem' }} />
          <Typography variant="body2">
            {user.profile.location?.city || 'Nearby'}
          </Typography>
        </Box>

        {user.profile.occupation && (
          <Box sx={{ display: 'flex', alignItems: 'center', mb: 1 }}>
            <WorkIcon sx={{ mr: 1, fontSize: '1.2rem' }} />
            <Typography variant="body2">{user.profile.occupation}</Typography>
          </Box>
        )}

        {user.profile.education && (
          <Box sx={{ display: 'flex', alignItems: 'center', mb: 1 }}>
            <SchoolIcon sx={{ mr: 1, fontSize: '1.2rem' }} />
            <Typography variant="body2">{user.profile.education}</Typography>
          </Box>
        )}

        <Box sx={{ display: 'flex', flexWrap: 'wrap', gap: 0.5 }}>
          {user.profile.interests?.map((interest, index) => (
            <Chip
              key={index}
              label={interest}
              size="small"
              sx={{
                backgroundColor: 'rgba(255, 255, 255, 0.2)',
                color: 'white',
                height: '24px',
                '& .MuiChip-label': {
                  fontSize: '0.75rem',
                  px: 1,
                },
              }}
            />
          ))}
        </Box>
      </CardOverlay>

      <ActionButtons>
        <ActionButton 
          color="pass" 
          onClick={() => handleAction('nope')}
          disabled={isAnimating}
        >
          <CloseIcon />
        </ActionButton>
        <ActionButton 
          color="superlike" 
          onClick={() => handleAction('superlike')}
          disabled={isAnimating}
        >
          <StarIcon />
        </ActionButton>
        <ActionButton 
          color="like" 
          onClick={() => handleAction('like')}
          disabled={isAnimating}
        >
          <FavoriteIcon />
        </ActionButton>
      </ActionButtons>
    </CardWrapper>
  );
};

export default SwipeCard;
